<html>
<head>
    <style>
        html, body {
            margin: 0;
            padding: 0;
            overflow: hidden;
            height: 1080px;
            width: 1920px;
            position: relative;
            outline: red 1px solid;
        }
        svg, img {
            position: absolute;
        }

        @import url("https://fonts.googleapis.com/css2?family=Montserrat&display=swap");

        svg.text {
            font-family: "Montserrat", sans-serif;
            /*width: 100%; height: 100%;*/
        }
        svg.text text {
            animation: stroke 5s infinite alternate;
            stroke-width: 2;
            stroke: #FFFFFF;
            font-size: 100px;
        }
        @keyframes stroke {
            0%   {
                fill: rgba(255,255,255,0); stroke: rgba(255,255,255,1);
                stroke-dashoffset: 25%; stroke-dasharray: 0 50%; stroke-width: 2;
            }
            70%  {fill: rgba(255,255,255,0); stroke: rgba(255,255,255,1); }
            80%  {fill: rgba(255,255,255,0); stroke: rgba(255,255,255,1); stroke-width: 3; }
            100% {
                fill: rgba(255,255,255,1); stroke: rgba(255,255,255,0);
                stroke-dashoffset: -25%; stroke-dasharray: 50% 0; stroke-width: 0;
            }
        }

        .wrapper {position: absolute;}
        @keyframes bounce {
            0%, 20%, 50%, 80%, 100% {transform: translateY(0);}
            40% {transform: translateY(-30px);}
            60% {transform: translateY(-15px);}
        }
        @keyframes Beat {
            0% {
                transform: scale(110%);
            }
            40% {
                transform: scale(100%);
            }
            100% {
                transform: scale(110%);
            }
        }

    </style>
    <script src="//unpkg.com/alpinejs" defer></script>
</head>

<script>
    document.addEventListener('alpine:init', () => {
        Alpine.data('loading', () => ({
            loading: 'loading-battery-low.svg',
            init() {
                setInterval(() => {
                    switch (this.loading) {
                        case 'loading-battery-low.svg':
                            this.loading = 'loading-battery-medium.svg'
                            break
                        case 'loading-battery-medium.svg':
                            this.loading = 'loading-battery-ok.svg'
                            break
                        case 'loading-battery-ok.svg':
                            this.loading = 'loading-battery-high.svg'
                            break
                        case 'loading-battery-high.svg':
                            this.loading = 'loading-battery-low.svg'
                            break
                    }
                }, 1000)
            }
        }))
    })
